.form-created {
  min-width: 486px;
  max-width: 600px;
  padding: 46px 54px;
  margin: 0 auto;
  border-radius: 6px;
  transition: all 0.3s ease;
  border: solid 1px transparent;
}
.form-created--red {
  background-color: #d24848;
}
.form-created--blue {
  background-color: #0d6efd;
}
.form-created--white {
  background-color: #fff;
  border: solid 1px #000;
}
.form-created--white .MuiFormHelperText-root {
  color: #d32f2f;
}
.form-created--white .form-created__name {
  color: #000;
}
.form-created--white .form-created__add-info {
  color: #000;
}
.form-created--white .form-created__add-comment {
  color: #000;
}
.form-created--white .form-created__button {
  border: solid 1px #000;
}
.form-created--white .form-created__button-text {
  color: #000;
}
.form-created--white .form-created__button-icon {
  color: #000;
}
.form-created__name {
  text-align: center;
  font-family: "Futura", "Arial", sans-serif;
  font-weight: 700;
  font-size: 36px;
  line-height: 40px;
  color: #fff;
  margin: 0 0 36px;
}
.form-created__wrapper {
  display: grid;
  grid-template-columns: 1fr 1fr;
  grid-template-rows: auto;
  row-gap: 24px;
  column-gap: 16px;
  margin: 0 auto 23px;
}
.form-created__button {
  display: flex;
  align-items: center;
  justify-content: center;
  column-gap: 9px;
  min-width: 281px;
  padding: 18px 30px;
  background: transparent;
  border: 1px solid #fff;
  border-radius: 6px;
  margin: 0 auto 16px;
  cursor: pointer;
}
.form-created__button-text {
  font-family: "SourceSansPro", "Arial", sans-serif;
  font-weight: 400;
  font-size: 18px;
  line-height: 23px;
  color: #fff;
}
.form-created__button-icon {
  color: #fff;
  transform: rotate(-90deg);
}
.form-created__button-icon svg {
  width: 16px;
  height: 12px;
}
.form-created__add-comment {
  width: max-content;
  display: flex;
  align-items: center;
  justify-content: center;
  column-gap: 4px;
  margin: 0 auto 25px;
  background-color: transparent;
  padding: 0;
  border: none;
  outline: none;
  font-family: "SourceSansPro", "Arial", sans-serif;
  font-style: normal;
  font-weight: 400;
  font-size: 14px;
  line-height: 18px;
  text-decoration-line: underline;
  color: #fff;
  cursor: pointer;
}
.form-created__add-comment--open .form-created__add-comment-icon {
  transform: rotate(180deg);
}
.form-created__add-comment-icon {
  transition: transform 0.3s ease;
}
.form-created__add-comment-icon svg {
  width: 15px;
  height: 10px;
}
.form-created__add-info {
  max-width: 438px;
  font-family: "SourceSansPro", "Arial", sans-serif;
  font-weight: 400;
  font-size: 10px;
  line-height: 13px;
  color: rgba(255, 255, 255, 0.7);
  margin: 0 auto;
}
.form-created__add-info a {
  color: inherit;
  text-decoration: underline;
}
